import React from 'react';
import { NavLink, Routes, Route } from 'react-router-dom';
import PhoneIcon from '@mui/icons-material/Phone';
import Footer from '../Footer/Footer';
import AboutUs from '../AboutUs/AboutUs';
import Support from '../Footer/Support';
import TermsOfUse from '../Footer/TermsOfUse';
import PrivacyPolicy from '../Footer/PrivacyPolicy';
import RendezVous from '../Consultation/RendezVous';  // Corrected the import name
import dinte from './dinte.jpg';
import classes from './MainPage.module.css';  // Import styles

const MainPage = () => {
  return (
    <>
      <header className={classes.header}>
        <div className={classes.logo}>
          <NavLink to='/home'>
            <img src={dinte} alt='Tooth' />
          </NavLink>
        </div>
        <nav className={classes.nav}>
          <ul>
            <li><NavLink to='/home/desprenoi' className={classes.link}>ABOUT US</NavLink></li>
            <li><NavLink to='/home/rendezvous' className={classes.link}>Consultation</NavLink></li>
          </ul>
        </nav>
      </header>

      <section className={classes.overview}>
        <h1 className={classes.mainTitle}>Cabinet Mehdi</h1>
        <div className={classes.phone}>
          <PhoneIcon className={classes.phoneIcon} />
          <p>Phone Nr. : 0611712311</p>
        </div>
      </section>

      <Routes>
        <Route path='/home/desprenoi' element={<AboutUs />} />
        <Route path='/home/rendezvous' element={<rendezVous />} />
        <Route path='/home/support' element={<Support />} />
        <Route path='/home/termsofuse' element={<TermsOfUse />} />
        <Route path='/home/privacypolicy' element={<PrivacyPolicy />} />
        <Route path='/home/rendezvous' element={<RendezVous />} /> {/* Added route for Consultation */}
      </Routes>

      <Footer />
    </>
  );
};

export default MainPage;
